import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

// react router
import { BrowserRouter as Router, Route } from 'react-router-dom';
// pages
import Home from './Home';
import About from './About';


const App = () => {
return (
    <>
<Router>
   <Switch>
<Route exact path="/">
<Home></Home>
</Route>
<Route exact path="/About">
<About></About>

</Route>
</Switch>
</Router>
</>
)
};

export default App;
